import logo from './logo.svg';
import './App.css';
import { Router } from '@reach/router'
import IndexView from './views/IndexView';
import CreateView from './views/CreateView';
function App() {
  return (
    <div>
      <Router>
        <IndexView path='/' />
        <CreateView path='/create' />
      </Router>
    </div>
  );
}

export default App;
